import './App.css';
import { ThemeProvider, Paper, useTheme } from '@material-ui/core';
import { theme } from './theme';
import Banner from './components/Banner';

function App() {
  const theme = useTheme();

  return (
    <ThemeProvider theme={theme}>
      <Paper style={{ height: "100vh" }}>
        <Banner />
      </Paper>
    </ThemeProvider>
  );
}

export default App;
